import React, { lazy } from "react";
import { Route, Routes } from "react-router-dom";
import { NotFoundPage } from "../pages/NotFound";
import { RoutesPagesProps } from "../types/routeTypes";

const ListItems = lazy(() => import('../pages/ListItems'));
const DetailedListItem = lazy(() => import('../pages/DetailedListItem'));

export const RoutesPages: React.FC<RoutesPagesProps> = ({ searchQuery, selectedCategory }) => {
  return (
    <Routes>
      <Route 
        path="/items" 
        element={<ListItems searchQuery={searchQuery} selectedCategory={selectedCategory} />} 
      />
      <Route 
        path="/items/:id" 
        element={<DetailedListItem />} 
      />
      <Route path="*" element={<NotFoundPage />} />
    </Routes>
  );
};
